const List = ({ item }) => {
  const {product, quentity, packed } = item;

  return (
    <li className="listWrapper">
      <span>{ quentity }</span>
      <p style={ packed ? { textDecoration: "line-through" } : {} }>{ product }</p>
      <div>
        <button className="doneBtn">Done</button>
        <button className="deleteBtn">Delete</button>  
      </div>
    </li>
  );
}
export default List;
